ALTER TABLE diva_pv_entry RENAME TO bak_diva_pv_entry;

CREATE TABLE `diva_pv_entry`
(
    `id`             bigint(20) NOT NULL,
    `demo_end`       datetime(6)                             DEFAULT NULL,
    `demo_start`     datetime(6)                             DEFAULT NULL,
    `difficulty`     varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
    `edition`        varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
    `playable_end`   datetime(6)                             DEFAULT NULL,
    `playable_start` datetime(6)                             DEFAULT NULL,
    `pv_id`          int(11)    NOT NULL,
    `version`        int(11)    NOT NULL
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = utf8mb4_unicode_ci;

ALTER TABLE `diva_pv_entry`
    ADD PRIMARY KEY (`id`),
    MODIFY `id` bigint(20) NOT NULL AUTO_INCREMENT,
    ADD UNIQUE KEY `UK_diva_pv_entry` (`pv_id`, `difficulty`, `edition`);


